import Home from './Home/Home.js';
import React from 'react';
import { BrowserRouter as Router , Route, Link, Switch } from 'react-router-dom';
const routes = [

  {
    path: "/",
    exact:true,
    component: Home
  }



];
export default function(props) {

  return (
        <div >
         <Router>
          <Switch>
            {routes.map((route, index) => (
            <Route key={index} {...route} />
             )
            )}
          </Switch>
         </Router>
        </div>
      );
}
